import React from "react";

function note(props) {
  return ( < div className = "note" >
    <
    h1 > {
      props.name
    } < /h1> <
    img className = "img-size"
    src = {
      props.image
    }
    alt = "celebrity-img" / >
    <
    p > {
      props.tel
    } < /p > <
    p > {
      props.email
    } < /p > < /
    div > );
}

export default note;
